public int compareTo(Resource other) {
  // compare memory and vcores first(in that order) to preserve
  // existing behaviour
  long diff = this.getMemorySize() - other.getMemorySize();
  if (diff == 0) {
    return this.getVirtualCores() - other.getVirtualCores();
  } else if (diff > 0){
    return 1;
  } else {
    return -1;
  }
}
